using Helper;
using System;
using System.Collections.Generic;
using System.Linq;

namespace Challenges.LeetCode.May
{
    public class AllAnagramsInString
    {

        /*
         Find All Anagrams in a String

        Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.
        Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.
        The order of output does not matter.

        Example1: 
            Input:
            s: "cbaebabacd" p: "abc"

            Output:
            [0, 6]

            Explanation:
            The substring with start index = 0 is "cba", which is an anagram of "abc".
            The substring with start index = 6 is "bac", which is an anagram of "abc".
         
        Example2:
            Input:
            s: "abab" p: "ab"

            Output:
            [0, 1, 2]

            Explanation:
            The substring with start index = 0 is "ab", which is an anagram of "ab".
            The substring with start index = 1 is "ba", which is an anagram of "ab".
            The substring with start index = 2 is "ab", which is an anagram of "ab".

         */


        public static void Run()
        {
            Base.Start(typeof(AllAnagramsInString));

            string s1 = "";
            string p1 = "";

            string s2 = "";
            string p2 = "";

            PerformanceProfiler.Compare(new Dictionary<string, Action>()
            {
                {nameof(FindAnagrams), ()=> { _ = FindAnagrams(s1,p1);_ = FindAnagrams(s2,p2);  } },

            }, 3);

            Base.End(typeof(AllAnagramsInString));
        }


        public static IList<int> FindAnagrams(string s, string p)
        {
            List<int> indexes = new List<int>();
            if (string.IsNullOrEmpty(s))
                return indexes;

            int pLength = p.Length;
            string sortedP = Sort(p);

            for (int i = 0; i < s.Length; i++)
            {

                if (i + pLength > s.Length)
                    break;

                string sub = s.Substring(i, pLength);
                string sortedSub = Sort(sub);

                if (sortedSub == sortedP)
                    indexes.Add(i);
            }

            return indexes;
        }

        private static string Sort(string input)
        {
            return new string(input.OrderBy(x => x).ToArray());
        }


        public static IList<int> FindAnagrams_Stackoverflow(string s, string p)
        {
            List<int> res = new List<int>();
            int[] s_map = new int[26];
            int[] p_map = new int[26];

            int s_len = s.Length;
            int p_len = p.Length;

            if (s_len < p_len)
                return res;

            for (int i = 0; i < p_len; i++)
            {
                ++s_map[s[i] - 'a'];
                ++p_map[p[i] - 'a'];
            }

            if (s_map == p_map)
                res.Add(0);

            for (int i = p_len; i < s_len; i++)
            {
                ++s_map[s[i] - 'a'];
                --s_map[s[i - p_len] - 'a'];

                if (s_map == p_map)
                    res.Add(i - p_len + 1);
            }

            return res;
        }

    }
}
